import React, {Component } from 'react';
import { Link } from 'react-router-dom';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Button } from 'reactstrap';

class HomePage extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
          isOpen: false
        };
      }

      toggle() {
        this.setState({
          isOpen: !this.state.isOpen
        });
      }
    render() {
        const mainBackground = {
            background: 'green',
            height: '100%'
          };

          const mainBody = {
            border: '1px solid gray', 
            background: 'white',
            height: '500px'
          };

          const navbar = {
            backgroundcolor: '#22DFD4'
          };

          const navbarText = {
            color: '#B9F7F3'
          };

          const backContainer = {
            height: '700px',
            width: '90%',
            backgroundcolor: 'red'
          };

          const test = {
            backgroundcolor: 'green'
          };

          const constheader = {
            width: '75%',
            height: '20%'
          };

          const spacingContainer = {
            height: '20px'
          };

          const promptText = {
            color: '#01A800'
          };

          const centerContainer = {
            height: '40%'
          };

          const getStartedContainer = {
            width: '50%',
            height: '20%'
          };
        return (
            <div style={mainBackground}>
            <div class="container mx-auto" style={backContainer}>
              <div id="header" class="text-center border-bottom containter pt-3 mx-auto">
              <font size="24" face = "Times New Roman">About Us</font>
              </div>
              <div class="container" style={spacingContainer}></div>

              <div class="container text-center">
                  <h1 class="lead font-italic">Here at Tyes we are focused on creating a device that provides more data to aid muscular spasticity recovery. We are currently working on improving the 9 Hole Peg Test (9-HPT) so that is provides more accurate data to the physical therapist. This helps the therapist personalize therapy for each patient. </h1>
                  </div>
                  <div class="container" style={spacingContainer}></div>
              <div class="container-fluid row">
              <img src="https://docs.google.com/drawings/d/e/2PACX-1vRboACGeCMPyMjo5ZFvULel-25nhQOVRTzqjAdd2DXLx0SlNhDGeSLj8sC7bNihznDdwO6jOWuD2Ngf/pub?w=1440&amp;h=1080" width = "400" height= "300"></img>
                <div class="containter" height= "300">
                        <Link to="/testPage"><button type="button" class="btn btn-outline-dark text-center btn-lg">Get Started</button></Link>
                    </div>
                    <div class="mask"></div>
              </div>
              </div>
        </div>
        )
    }
}

export default HomePage;
